import React, { useState } from 'react'
import { MDBNavbar, MDBNavbarBrand, MDBNavbarToggler } from 'mdb-react-ui-kit';


const Header: React.FunctionComponent = () => {
    const [show, setShow] = useState(false);
    return (
        <MDBNavbar fixed='top' expand="lg" style={{ backgroundColor: "#f0e6ea" }}>
            <MDBNavbarBrand style={{ marginLeft: 10 }} >
                <strong className="white-text" style={{ color: "#606080" }} >Tour</strong>
            </MDBNavbarBrand>
            <MDBNavbarToggler onClick={() => setShow(!show)} />
        </MDBNavbar>
    );
}


export { Header };
